import React from 'react';

const NameList=()=>{
    const persons=[
        {
            id:1,
            name:'shivam'
        },
        {
            id:2,
            name:'rakesh'
        },
        {
            id:3,
            name:'satyam'
        }
    ]

    return(
      <div>
          persons.map((person) => <h2>{person}</h2>)
      </div>
    )
}
export default NameList
